import React from 'react';
import Moment from 'react-moment';

import { fetchWeekForecast } from '../../utils/api';

import '../../styles/components/weather/_forecast.scss';

export default function WeeklyForecast({ forecast }) {

	return (
		<div className='forecast-list'>
			{
				forecast.map((timeframe) => (
					<div key={timeframe.dt} className='forecast'>
						<span className='forecast-time'>MORN</span>
						<div className='forecast-info'>
							<span className='temperature'>5</span>
							<Moment parse='HH:mm'>{timeframe.dt_txt}</Moment>
						</div>
					</div>
				))
			}
		</div>
	)
}
